import '../App.css';
import '../components/offer'
import Offer from '../components/offer';

function Marketplace({offers}) {
	return (
		<div className="Marketplace">
			{offers.map((offer) => 
				<Offer data={offer}/>
			)}
			<div className='offerList'>
				<Offer />
				<Offer />
				<Offer />
				<Offer />
			</div>
		</div>
	);
}

export default Marketplace;
